import React, {  useState } from "react";
import { useAuthState } from "react-firebase-hooks/auth";
import { auth, db, logout } from "../firebase";

function Logout() {
    return (
      <div className="Logout">
        {logout()}
      </div>
    );
}

export default Logout;
